import React, { useState } from 'react';

const AIFinancialAnalysis = () => {
  const [aiInsights, setAiInsights] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);

  const expenses = [
    { category: "Alimentación", amount: 300 },
    { category: "Transporte", amount: 150 }
  ];

  const savings = [
    { month: "Enero", amount: 500 },
    { month: "Febrero", amount: 600 }
  ];

  const fetchAIAnalysis = async () => {
    setIsLoading(true);
    setError(null);

    try {
      const response = await fetch('http://localhost:11434/api/generate', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          model: 'llama3.2:3b-instruct-q8_0',
          prompt: `Genera un JSON con este formato exacto, sin texto adicional ni explicaciones:
{
  "gastosTotales": [suma total de ${JSON.stringify(expenses)}],
  "ahorrosTotales": [suma total de ${JSON.stringify(savings)}],
  "analisisGastos": "Analiza los gastos: ${JSON.stringify(expenses)}",
  "progresoAhorros": "Analiza el progreso: ${JSON.stringify(savings)}",
  "recomendaciones": [
    "recomendación 1",
    "recomendación 2",
    "recomendación 3"
  ],
  "categoriasMayorGasto": ["categorías ordenadas por monto"],
  "potencialAhorro": [estimación numérica]
}`
        })
      });

      const data = await response.json();
      const aiResponse = data.response.trim();
      console.log('Respuesta del modelo:', aiResponse);

      try {
        // Intenta encontrar el JSON en la respuesta
        const jsonMatch = aiResponse.match(/\{[\s\S]*\}/);
        if (!jsonMatch) {
          throw new Error('No se encontró un JSON válido en la respuesta');
        }

        const jsonStr = jsonMatch[0];
        console.log('JSON encontrado:', jsonStr);

        const parsedData = JSON.parse(jsonStr);
        setAiInsights(parsedData);
      } catch (parseError) {
        console.error('Error parseando JSON:', parseError);
        throw new Error('No se pudo procesar la respuesta del modelo');
      } finally {
        setIsLoading(false);
      }
    } catch (error) {
      console.error('Error:', error);
      setError('Error al procesar la respuesta del modelo. Por favor, intenta de nuevo.');
      setIsLoading(false);
    }
  };

  return (
    <div className="p-4 space-y-6 bg-white rounded-lg shadow">
      <button
        onClick={fetchAIAnalysis}
        disabled={isLoading}
        className={`w-full py-3 px-4 rounded-lg text-white font-medium transition-colors ${
          isLoading ? 'bg-gray-400' : 'bg-blue-600 hover:bg-blue-700'
        }`}
      >
        {isLoading ? 'Analizando...' : 'Obtener Análisis'}
      </button>

      {error && (
        <div className="p-4 bg-red-50 border border-red-200 rounded-lg text-red-700">
          {error}
        </div>
      )}

      {aiInsights && (
        <div className="space-y-6">
          <div className="grid grid-cols-2 gap-4">
            <div className="p-4 bg-blue-50 rounded-lg">
              <p className="text-sm text-blue-600 font-semibold">Gastos Totales</p>
              <p className="text-2xl font-bold">{aiInsights.gastosTotales}€</p>
            </div>
            <div className="p-4 bg-green-50 rounded-lg">
              <p className="text-sm text-green-600 font-semibold">Ahorros Totales</p>
              <p className="text-2xl font-bold">{aiInsights.ahorrosTotales}€</p>
            </div>
          </div>

          <div className="space-y-4">
            <div className="border-b pb-4">
              <h3 className="font-semibold text-lg mb-2">Análisis de Gastos</h3>
              <p className="text-gray-700">{aiInsights.analisisGastos}</p>
            </div>

            <div className="border-b pb-4">
              <h3 className="font-semibold text-lg mb-2">Progreso de Ahorros</h3>
              <p className="text-gray-700">{aiInsights.progresoAhorros}</p>
            </div>

            <div className="border-b pb-4">
              <h3 className="font-semibold text-lg mb-2">Categorías con Mayor Gasto</h3>
              <div className="flex gap-2">
                {aiInsights.categoriasMayorGasto.map((categoria, index) => (
                  <span 
                    key={index}
                    className="px-3 py-1 bg-gray-100 rounded-full text-sm text-gray-700"
                  >
                    {categoria}
                  </span>
                ))}
              </div>
            </div>

            <div>
              <h3 className="font-semibold text-lg mb-2">Recomendaciones</h3>
              <ul className="space-y-2">
                {aiInsights.recomendaciones.map((rec, index) => (
                  <li 
                    key={index}
                    className="flex items-start"
                  >
                    <span className="mr-2">•</span>
                    <span className="text-gray-700">{rec}</span>
                  </li>
                ))}
              </ul>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default AIFinancialAnalysis;
